import React from 'react';
import './style.css';
import {Button,Link} from '@material-ui/core';
import logo from './images/logo2.png';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '20rem',
    },
  },
}));


const Sign_in = () => {

    const classes = useStyles();
  

  return (
    <div className="container1">
        <h1>Sign into CoralOS</h1>
        <p>Continue with the Google account or email address you use to sign in.</p>
        <Button className="button1" variant="outlined" ><img src={logo} />Continue with Google</Button>
        <div className="Text1"><span>or</span></div>
        <form className={classes.root} noValidate autoComplete="off">
            <TextField id="outlined-basic" label="Email Address" variant="outlined" />
        </form>
        <form className={classes.root} noValidate autoComplete="off">
            <TextField id="outlined-basic" label="Password" variant="outlined" />
        </form>
        <p>Remember me</p> 
        <Button className="button2">Sign in</Button>
        <div className="linkdiv1"><Link to='/Sign_up'  className="link1">Forgot your password?</Link></div>
    </div>
  );
};

export default Sign_in;
